const Movies = ({ title, poster_path, overview, vote_average }) => {
  const IMG = "https://image.tmdb.org/t/p/w1280";
  return (
    <div class="movie">
      <div id="movie-poster">
        <img src={IMG + poster_path} id="poster" alt={title} />
        <div className="movie-info">
          <h3> {title} </h3>
          <span>
            <h4>Ratings : {vote_average}/10</h4>
          </span>
        </div>
      </div>
    </div>
  );
};

export default Movies;
